import React from "react";
import { FaFileCsv, FaFileExcel, FaFileCode } from "react-icons/fa";

function DatasetList({ datasets }) {
  if (datasets.length === 0) {
    return <p>No datasets found.</p>;
  }

  const getFormatIcon = (format) => {
    switch (format) {
      case "CSV":
        return <FaFileCsv className="format-icon" />;
      case "Excel":
        return <FaFileExcel className="format-icon" />;
      case "JSON":
        return <FaFileCode className="format-icon" />;
      default:
        return null;
    }
  };

  return (
    <div className="dataset-list">
      {datasets.map((dataset) => (
        <div key={dataset.id} className="dataset">
          <h3>
            {getFormatIcon(dataset.format)} {dataset.dataset_name}
          </h3>
          <p><strong>Description:</strong> {dataset.description}</p>
          <p><strong>Source:</strong> {dataset.source}</p>
          <p><strong>Columns:</strong> {dataset.columns}</p>
          <p><strong>Update Frequency:</strong> {dataset.update_frequency}</p>
          <p><strong>Last Updated:</strong> {dataset.last_updated}</p>
          <p><strong>Format:</strong> {dataset.format}</p>
        </div>
      ))}
    </div>
  );
}

export default DatasetList;
